import React from 'react';
// Import the BrowserRouter, Route and Link components
import { BrowserRouter, Route, Switch } from 'react-router-dom'; 
import { Link, animateScroll as scroll } from "react-scroll";
import Projects from './Projects'; 
import Blog from './Blog'; 
import About from './About'; 
import PostPage from './PostPage';
import './App.css';

function App() {
  return (

    <BrowserRouter>

      <div className="App">

        <nav className="nav" id="navbar">
          <div className="nav-content">

            <ul className="nav-items">
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="projects"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  PROJECTS
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section2"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 2
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section3"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 3
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section4"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 4
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section5"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 5
                </Link>
              </li>
            </ul>
          </div>
        </nav>

        <Switch>
          <Route exact path="/" component={Projects} />
          <Route path="/blog/:id" component={PostPage} />
          <Route path="/blog" component={Blog} />
          <Route path="/about" component={About} />
        </Switch>




      </div>
    </BrowserRouter>
  );
}

export default App;

